    def addOperators(self, num, target):
        """
        :type num: str
        :type target: int
        :rtype: List[str]
        """

        def dfs(num, target, start, cur, res):
            if start == len(num):
                if cur == target:
                    res.append(cur)
                return
            for i in range(start, len(num)):
                if i > start and num[start] == '0':
                    break
                dfs(num, target, i + 1, cur + int(num[start:i + 1]), res)
                dfs(num, target, i + 1, cur - int(num[start:i + 1]), res)
                dfs(num, target, i + 1, cur * int(num[start:i + 1]), res)

        res = []
        dfs(num, target, 0, 0, res)
