class Solution(object):
    def ladderLength(self, beginWord, endWord, wordList):
        """
        :type beginWord: str
        :type endWord: str
        :type wordList: List[str]
        :rtype: int
        """

        # 1. 构建字典
        word_dict = {}
        for word in wordList:
            word_dict[word] = 1

        # 2. 构建队列
        queue = []
        queue.append(beginWord)

        # 3. 构建字典
        visited = {}
        visited[beginWord] = 1

        # 4. 构建字典
        step = 1
        while queue:
            size = len(queue)
            for i in range(size):
                word = queue.pop(0)
                for j in range(len(word)):
                    for k in range(ord('a'), ord('z')+1):
                        new_word = word[:j] + chr(k) + word[j+1:]
