class Solution(object):
    def removeInvalidParentheses(self, s):
        """
        :type s: str
        :rtype: List[str]
        """

        def isValid(s):
            stack = []
            for c in s:
                if c == '(':
                    stack.append(c)
                elif c == ')':
                    if not stack:
                        return False
                    else:
                        stack.pop()
            return not stack

        def backtrack(s, start, end, res):
            if start == end:
                if isValid(s):
                    res.append(s)
                return
            for i in range(start, end + 1):
                if s[i] == '(' or s[i] == ')':
                    s[i], s[start] = s[start], s[i]
                    backtrack(s, start + 1, end, res)
                    s[i], s[start] = s[start], s[i]

        res = []
        backtrack(list(s), 0, len(s) - 1, res)
