        :rtype: ListNode
        """

        # Merge two sorted linked lists
        def mergeTwoLists(l1, l2):
            dummy = ListNode(0)
            curr = dummy
            while l1 and l2:
                if l1.val < l2.val:
                    curr.next = l1
                    l1 = l1.next
