        :type triangle: List[List[int]]
        :rtype: int
        """

        # 1. initialize the first row
        # 2. for each row, calculate the minimum value of the current row and the previous row
        # 3. return the minimum value of the last row

        # initialize the first row
        for i in range(1, len(triangle)):
            triangle[i][0] += triangle[i-1][0]
            triangle[i][-1] += triangle[i-1][-1]

        # for each row, calculate the minimum value of the current row and the previous row
        for i in range(1, len(triangle)):
            for j in range(1, len(triangle[i])):
                triangle[i][j] += min(triangle[i-1][j-1], triangle[i-1][j])

        # return the minimum value of the last row
        return min(triangle[-1])

